import React from 'react';

function InfoTable(props){
	const stores = props.stores;
	console.log(stores);
	return (
		<div>
			<table>
				<thead>
					<th>City</th>
					<th>Temperature</th>
					<th>Pressure</th>
					<th>Humidity</th>
					<th>Description</th>
					<th>Wind Speed</th>
				</thead>
			</table>
		</div>
	);
}

export default InfoTable;
